MATCH (d:Drug)-[:DrugHasIndication]->(dis:Disorder)
WHERE toLower(d.displayName) = toLower('Ropinirole')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName;

MATCH (d:Drug)
WHERE toLower(d.displayName) = toLower('Ribavirin')
RETURN d.primaryDomainId AS drugId, d.displayName AS drugName, d.casNumber AS casNumber;

MATCH (g:Gene)-[r:GeneAssociatedWithDisorder]->(dis:Disorder {primaryDomainId:'mondo.0016419'})
WHERE r.scoreOpenTargets IS NULL OR r.scoreOpenTargets > 0.3
RETURN DISTINCT g.primaryDomainId AS geneId, g.displayName AS geneName, g.approvedSymbol AS symbol;

MATCH (dis:Disorder)
WHERE toLower(dis.displayName) = toLower('Li-Fraumeni syndrome')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName, dis.dataSources AS dataSources;

MATCH (dis:Disorder)
WHERE toLower(dis.displayName) = toLower('Wilson disease')
RETURN dis.primaryDomainId AS disorderId, dis.displayName AS disorderName, dis.icd10 AS icd10Codes;

MATCH (s:Signature)
WHERE toLower(s.displayName) = toLower('Immunoglobulin signature')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName, s.dataSources AS dataSources;

MATCH (go:GO)
WHERE toLower(go.displayName) = toLower('plasma membrane')
RETURN go.description AS description, go.dataSources AS dataSources;

MATCH (p:Protein)
WHERE toLower(p.displayName) = toLower('MYC_HUMAN')
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, p.sequence AS aminoAcidSequence;

MATCH (p:Protein)-[:ProteinHasSignature]->(s:Signature)
WHERE toLower(p.displayName) = toLower('CUL3_HUMAN')
RETURN s.primaryDomainId AS signatureId, s.displayName AS signatureName;

MATCH (p:Protein)-[:ProteinHasGOAnnotation]->(go:GO)
WHERE toLower(p.displayName) CONTAINS 'p53_human'
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, go.primaryDomainId AS goId, go.displayName AS goName;

MATCH (p:Protein) 
WHERE toLower(p.displayName) = toLower('HSP7C_HUMAN') 
RETURN p.primaryDomainId AS proteinId, p.displayName AS proteinName, p.synonyms AS synonyms;

MATCH (g:Gene)
WHERE toLower(g.displayName) = toLower('MSH2')
RETURN g.primaryDomainId AS geneId, g.displayName AS displayName, g.approvedSymbol AS approvedSymbol, g.synonyms AS synonyms;
